function getClassementPoule(lienDivision,numeroEquipe){if(!alreadyCalledClassementPoule.includes(numeroEquipe)){alreadyCalledClassementPoule.push(numeroEquipe);$.ajax({url:"/journee/classement-poule",type:"POST",data:{lienDivision:lienDivision},dataType:"json",success:responseTemplate=>{templatingClassementPoule(numeroEquipe,responseTemplate)},error:()=>{templatingClassementPoule(numeroEquipe,"<p style='margin-top: 10px' class='pastille reset red'>Le service de la FFTT rencontre des perturbations. RÃ©essayez plus tard</p>")}})}}function templatingClassementPoule(numeroEquipe,response){$("#classementContent"+numeroEquipe).html(response)}let alreadyCalledClassementPoule=[];